import Dog from './Dog';
import DogsInfo from './DogInfo';
import { v4 as uuid } from "uuid";

const Home = ()=>{
    return (
        <div className="App">
          <h1>Dog Finder</h1>
          {DogsInfo.map(({name,age,src}) =>{
            return(
              <Dog
                name={name}
                age={age}
                img = {src}
                key={uuid()}
              />
            )
          })}
        </div>
      );
}
export default Home
